import requests

sso_endpoint = 'https://portal-sso.wise-paas.com/v2.0'
username = ''
password = ''

payload = {'username': username, 'password': password}

path = '{}/auth/native'.format(sso_endpoint)
resp = requests.post(path, json=payload)

if resp.status_code == 200:
    resp = resp.json()
    tokenType = resp['tokenType']
    accessToken = resp['accessToken']
    token = '{} {}'.format(tokenType, accessToken)
    print(token)
    # [Out ] Bearer eyJhbGciOiJIUzUxMiJ9..16NNoblHw8ug1vAt7KoArpfpcSErvHD8LDZUJB-KXnTVapuTHt-AILqZYoiHWjOKt2M-VWmqJk4puyQxRc3hCw
else:
    print(resp.status_code, resp.text)